import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { AuthCotextProvider } from "./context/authContext";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <AuthCotextProvider>
      <App />
    </AuthCotextProvider>
  </React.StrictMode>
);
